package com.wilson.dategram;//cimid,terminalId_speed_public class testInfoGPSGram {	//cimID	private String cimId;	//时间(时间戳格式)	private String time;	//终端ID	private String terminalId;	//速度(单位：km/h)	private Double speed;	//卫星个数	private int satelliteNum;	//在线状态	private int onlineStatus;	public int getOnlineStatus() {		return onlineStatus;	}	public void setOnlineStatus(int onlineStatus) {		this.onlineStatus = onlineStatus;	}	public String getCimId() {		return cimId;	}	public void setCimId(String cimId) {		this.cimId = cimId;	}	public String getTime() {		return time;	}	public void setTime(String time) {		this.time = time;	}	public String getTerminalId() {		return terminalId;	}	public void setTerminalId(String terminalId) {		this.terminalId = terminalId;	}	public Double getSpeed() {		return speed;	}	public void setSpeed(Double speed) {		this.speed = speed;	}	public int getSatelliteNum() {		return satelliteNum;	}	public void setSatelliteNum(int satelliteNum) {		this.satelliteNum = satelliteNum;	}}